CREATE TABLE `wja_config` (
  `config_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `post_user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '添加config用户ID',
  `config_key` varchar(255) NOT NULL DEFAULT '',
